                    <div class="tab-pane   in active" id = "tab1" >


                        <html><head><meta charset="utf-8"></head><body>
<p>Лакомство для собак CHOCO DOG печенье в тёмном шоколаде<br />Собаки обожают похрустеть чем-то вкусненьким.</p>
<p>Мы покрыли печенье полезным собачьим шоколадом и получили хрустящее лакомство, которое доставит ещё больше удовольствия четвероногому сладкоежке.</p>
</body></html>

                    </div>
                
            
                


                

                    <div class="tab-pane  "  id = "tab5">


                        <html><head><meta charset="utf-8"></head><body>
<p><strong>Назначение</strong>:<br />&laquo;CHOCO DOG&reg; печенье в темном шоколаде&raquo; лакомство для собак представляет собой дополнительный функциональный корм для непродуктивных животных, предназначенный для использования в качестве лакомства с целью поощрения и дрессуры животных. Корм оказывает позитивное влияние практически на все системы организма. Печенье в шоколаде не содержит сахара, теобромина и кофеина, не вызывает аллергии.</p>
<p><strong>Функциональная ценность компонентов</strong>:</p>
<p>Экстракт стевии (стевиозид) &mdash; природный подсластитель, который слаще сахара в 30 раз. Регулярное употребление способствует улучшению регенерации клеток и свойств крови, укреплению кровеносных сосудов. Экстракт стевии (стевиозид) способствует профилактике сердечно&mdash;сосудистых заболеваний, диабета, ожирения и других болезней обмена веществ.</p>
<p>Мука плодов рожкового дерева &ndash; натуральный заменитель какао, содержащий богатый набор белков, минеральных веществ и витаминов (А, В, В2, В3, D) и минеральных веществ (кальций, фосфор, калий, магний, железо, медь, никель, марганец). Плоды рожкового дерева в отличие от какао не содержат кофеина и теобромина, которые недопустимы для включения в состав корма для собак.</p>
<p>Лецитин обеспечивает естественные пищевые потребности организма, способствует восстановлению системы мембранного аппарата клеток, помогает усвоению жирорастворимых витаминов А, Д, Е и К, необходимых для питания всех клеток организма, улучшает функции печени и почек.</p>
<p>Альбумин черный &ndash; это источник белков, жиров, углеводов и минералов. Альбумин содержит оптимальное соотношение аминокислот, стимулирует кроветворение и служит источником витамина А.</p>
<p><strong>Состав, энергетическая и пищевая ценность</strong>:<br />Состав шоколада: заменитель масла какао, лактоза, сухая молочная сыворотка, порошок рожкового дерева, лецитин, альбумин черный пищевой, стевиозид, пищевой ароматизатор.</p>
<p>Состав печенья: мука пшеничная хлебопекарная 1 сорта, вода питьевая, дрожжи хлебопекарные, соль, разрыхлитель (натрий двууглекислый), регулятор кислотности (кислота молочная).</p>
<p>Пищевая ценность в 100 г:</p>
<p>Белки 5,0 г</p>
<p>Жиры 30 г</p>
<p>Углеводы 55 г</p>
<p>Энергетическая ценность в 100 г: 505 ккал</p>
<p><strong>Особенности применения</strong>:<br />возможна индивидуальная повышенная чувствительность или непереносимость отдельных компонентов.</p>
<p><strong>Фасовка</strong>:<br />&laquo;CHOCO DOG&reg; печенье в темном шоколаде&raquo; лакомство для собак выпускают в виде плиток (шоколад +печенье) прямоугольной формы с фигурными краями с логотипом VEDA на верхней шоколадной поверхности и печеньем на нижней поверхности, упакованных по 4 штуки общей массой 30 г в контейнер (коррекс), помещенный в пакет из пленки. Допускается использование других видов упаковочных материалов, разрешенных для использования в установленном порядке для упаковывания лекарственных средств и пищевых продуктов.</p>
<p><strong>Условия хранения</strong>:<br />корм хранят в хорошо проветриваемых сухих, чистых помещениях, не имеющих постороннего запаха при температуре (18&plusmn;3) ˚С при относительной влажности воздуха не более 75%.</p>
<p><strong>Срок годности</strong>:<br />12 месяцев.</p>
</body></html>
